from typing import List
from collections import Counter

class Solution:
    def numberOfNodes(self, n: int, queries: List[int]) -> int:
        res = 0
        cntr = Counter(queries)
        for i in range(1, n+1):
            tmp = 0
            while i > 0:
                tmp += cntr[i] if i in cntr else 0
                i //= 2
            res += 1 if tmp % 2 == 1 else 0
        return res

